// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login'; // Asegúrate de que la ruta sea correcta
import Home from './pages/Home';   // Asegúrate de que la ruta sea correcta
import DashboardLayoutNavigationLinks from './components/DashboardLayoutNavigationLinks';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/dashboard" component={DashboardLayoutNavigationLinks} />
        <Route path="/home" component={Home} />
        <Route path="/" component={Login} />
      </Switch>
    </Router>
  );
};
export default App;
